@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

atm:Account a owl:Class .
atm:Withdrawal a owl:Class .

atm:dispensesMoney a owl:ObjectProperty ;
  rdfs:domain atm:Withdrawal ;
  rdfs:range atm:Account .

atm:updatesAccount a owl:ObjectProperty ;
  rdfs:domain atm:Withdrawal ;
  rdfs:range atm:Account .

atm:dispensesMoney rdfs:subPropertyOf atm:updatesAccount .
